import React from 'react';
import { useNavigate } from 'react-router-dom'; // <--- 1. Importe o hook de navegação
import './TelaInicial.css';

function TelaInicial() {
  // 2. Inicialize o hook useNavigate
  const navigate = useNavigate(); 

  // 3. Defina a função que será executada no clique do botão
  const handleClick = () => {
    // Navega para a rota '/MenuPrincipal'
    navigate('/MenuPrincipal'); 
  };

  return (
    <div className="tela-container">
      {/* ... Código do vídeo ... */}

      <div className="conteudo">
        {/* ... Logo e texto ... */}

        {/* O onClick agora chama a função definida acima */}
        <button className="btn-explorar" onClick={handleClick}>
          Start exploring
        </button>
      </div>
    </div>
  );
}

export default TelaInicial;
